// SPDX-License-Identifier: MIT


import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";

pragma solidity >=0.6.0 <0.9.0;

contract GogglesNFT is ERC721Enumerable, Ownable {

    // CommissionFee percent is 2.5%
    uint256 public commissionFee = 25;
    uint256 public denominator = 10;

    struct Item {
        uint256 id;
        address creater;
        string uri;
    }
    // tokenId => item
    mapping (uint256 => Item) public Items;

    address payable public _feeAddress;
    // tokenId => inBlackList
    mapping (uint =>  bool) public blackList;
    // tokenId => price
    mapping (uint => uint) public price;
    // tokenId => isListed?
    mapping (uint => bool) public listedMap;

    event Purchase(address indexed previousOwner, address indexed newOwner, uint price, uint nftID, string uri);

    event Minted(address indexed minter, uint price, uint nftID, string uri);

    event PriceUpdate(address indexed owner, uint oldPrice, uint newPrice, uint nftID);

    event UpdateListStatus(address indexed owner, uint nftID, bool isListed);

    event UpdateBlackList(uint256 nftID, bool isBlackList);

    constructor(address _owner) ERC721("GogglesNFT", "GOST") {
        require(_owner != address(0x0), "Invalid address");
        _feeAddress = payable(_owner);
    }

    modifier notBlackList(uint256 _tokenId) {
        require(blackList[_tokenId] == false, "TokenId is in blackList");
        _;
    }

    // Create item
    function mint(string memory _tokenURI, address _toAddress, uint _price) public returns (uint) {
        require(_toAddress != address(0x0), "Invalid address");

        uint _tokenId = totalSupply(); 
        price[_tokenId] = _price;
        listedMap[_tokenId] = true;

        _safeMint(_toAddress, _tokenId);
        
        Item storage item = Items[_tokenId];
        item.uri = _tokenURI;
        item.id = _tokenId;
        item.creater = _toAddress;

        emit Minted(_toAddress, _price, _tokenId, _tokenURI);

        return _tokenId;
    }

    // Batch creation
    function batchMint(string memory _tokenURI, address _toAddress, uint _price, uint _amount) external {
        require(_amount > 0, "wrong amount");

        for(uint idx = 0; idx < _amount; idx++) {
            mint(_tokenURI, _toAddress, _price);
        }
    }

    function tokenURI(uint256 tokenId) public view  override returns (string memory) {
        require(_exists(tokenId), "ERC721Metadata: URI query for nonexistent token");

        return Items[tokenId].uri;
    }

    // TokenId
    function buy(uint _id) notBlackList(_id) external payable {
        _validate(_id);

        address _previousOwner = ownerOf(_id);
        address _newOwner = msg.sender;

        _trade(_id);

        emit Purchase(_previousOwner, _newOwner, price[_id], _id, tokenURI(_id));
    }

    function _validate(uint _id) internal {
        bool isItemListed = listedMap[_id];
        require(_exists(_id), "Error, wrong tokenId");
        require(isItemListed, "Item not listed currently");
        require(msg.value >= price[_id], "Error, the amount is lower");
        require(msg.sender != ownerOf(_id), "Can not buy what you own");
    }

    function _trade(uint _id) internal {
        address payable _buyer = payable(msg.sender);
        address payable _owner = payable(ownerOf(_id));

        _transfer(_owner, _buyer, _id);

        // commission cut
        uint _commissionValue = price[_id] * commissionFee / denominator / 100 ;
        uint _sellerValue = price[_id] - _commissionValue;

        _owner.transfer(_sellerValue);
        _feeAddress.transfer(_commissionValue);

        // If buyer sent more than price, we send them back their rest of funds
        if (msg.value > price[_id]) {
            _buyer.transfer(msg.value - price[_id]);
        }

        listedMap[_id] = false;
    }

    // Update owner's NFT price
    function updatePrice(uint _tokenId, uint _price) notBlackList(_tokenId) public returns (bool) {
        uint oldPrice = price[_tokenId];
        require(msg.sender == ownerOf(_tokenId), "Error, you are not the owner");
        price[_tokenId] = _price;

        emit PriceUpdate(msg.sender, oldPrice, _price, _tokenId);
        return true;
    }

    function updateListingStatus(uint _tokenId, bool shouldBeListed) notBlackList(_tokenId) public returns (bool) {
        require(msg.sender == ownerOf(_tokenId), "Error, you are not the owner");

        listedMap[_tokenId] = shouldBeListed;

        emit UpdateListStatus(msg.sender, _tokenId, shouldBeListed);

        return true;
    }

    // Update the fee address
    function updateFeeAddress(address newFeeAddress) external onlyOwner {
        require(_feeAddress != newFeeAddress, "Fee address: already set");
        require(newFeeAddress != address(0x0), "Zero address is not allowed for fee address");

        _feeAddress = payable(newFeeAddress);
    }

    // BlackList
    function addBlackList(uint256 _tokenId) external onlyOwner {
        require(blackList[_tokenId] == false, "Already in blacklist");
        blackList[_tokenId] = true;

        listedMap[_tokenId] = false;
        emit UpdateListStatus(msg.sender, _tokenId, false);
        emit UpdateBlackList(_tokenId, true);
    }

    function removeBlackList(uint256 _tokenId) external onlyOwner {
        require(blackList[_tokenId], "Not exist in blacklist");

        blackList[_tokenId] = false;

        emit UpdateBlackList(_tokenId, false);
    }

    // Withdraw ERC20 tokens
    // For unusual case, if customers sent their any ERC20 tokens into marketplace, we need to send it back to them
    function withdrawTokens(address _token, uint256 _amount) external onlyOwner {
        require(IERC20(_token).balanceOf(address(this)) >= _amount, "Wrong amount");

        IERC20(_token).transfer(msg.sender, _amount);
    }

    // withdraw BNB
    function withdrawAll() public onlyOwner {
        uint256 balance = address(this).balance;
        require(balance > 0);
        _widthdraw(msg.sender, balance);
    }

    function _widthdraw(address _address, uint256 _amount) private {
        (bool success, ) = _address.call{value: _amount}("");
        require(success, "Transfer failed.");
    }
}
